import { IconButton } from "@mui/material";
import { CloseSidebar, MiddleDivider, SidebarBg, SidebarContainer, SidebarHeader, SidebarTitle } from "../../styles/dashboard/DashboardSidebar";
import ShoppingBagIcon from '@mui/icons-material/ShoppingBag';
import CloseIcon from '@mui/icons-material/Close';


export default function DashboardSidebar(){
    return(
        <SidebarContainer>          
            <SidebarBg></SidebarBg>
            <SidebarHeader>
                <IconButton><ShoppingBagIcon /></IconButton>
                <SidebarTitle variant="h4">My Bags</SidebarTitle>
                <CloseSidebar><CloseIcon/></CloseSidebar>
            </SidebarHeader>
            <MiddleDivider/>
        </SidebarContainer>
    )
}
